import React from 'react';
import Button from './Button';
import '../styles/Buttons.css';

class Buttons extends React.Component{
	render({click}){


		return(
			<div className='container'>
				 <div className='column'>
					 <Button number='7' clicked={click}/>
					 <Button number='4' clicked={click}/>
					 <Button number='1' clicked={click}/>
					 <Button number='0' clicked={click}/>
				</div>
				 <div className='column'>
				 	<Button number='8' clicked={click}/>
				 	<Button number='5' clicked={click}/>
				 	<Button number='2' clicked={click}/>

				</div>
				<div className='column'>
					 <Button number='9' clicked={click}/>
					 <Button number='6' clicked={click}/>
					 <Button number='3' clicked={click}/>
					 <Button size='large' number='=' clicked={click}/>

				</div>
				<div className='column'>
					 <Button number='x' clicked={click}/>
					 <Button number='%' clicked={click}/>
					 <Button number='+' clicked={click}/>
					 <Button number='-' clicked={click}/>
				</div>
			</div>

		);
	}
}

export default Buttons;
